import React from 'react';
const product_data = require('./products.json');
class ReadData extends React.Component
{
  readData(jsonData)
  {
    var ret="";
    for(let data in jsonData)
    {
      if(typeof(jsonData[data])=="object")
        ret+=this.readData(jsonData[data]);
      if(typeof(jsonData[data])!="object" && data!="Brand")
        ret+="<div>" + data + " : " + jsonData[data] + "</div>";
    }
    return ret;
  }
  render()
  {
    document.write("<div>" + this.readData(product_data) + "</div>");
    return(
      <div></div>
    );
  }
}
export default ReadData;
